import { DrawingConfig } from "./DrawingConfig";
import { DrawingContext } from "./DrawingContext";
// Import stylesheets
import "./style.css";

// Write TypeScript code!
const appDiv: HTMLElement = document.getElementById("app");
appDiv.innerHTML = `<h1>Html Canvas Clip-Path generator</h1>`;

const canvas: HTMLCanvasElement = document.getElementById(
  "canvas2"
) as HTMLCanvasElement;
const config = new DrawingConfig();

const drawingContext = new DrawingContext(canvas, config);

const img1 = new Image();
img1.onload = function() {
  // ctx.drawImage(img1, 40, 10);
  // drawingContext.canvas.width = img1.width;
  // drawingContext.canvas.height = img1.height;
  //drawingContext.renderer.drawImage(img1, 0, 0, canvas.width, canvas.height);
  drawingContext.init(img1);

  setInterval(function() {
    let clipPath = "<ul>";
    for (let i = 0; i < drawingContext.shapes.length; i++) {
      clipPath +=
        "<li>" + drawingContext.shapes[i].getClipPath(drawingContext) + "</li>";
    }
    clipPath += "</ul>";
    document.getElementById("clip-path").innerHTML = clipPath;
  }, 2000);

  // console.log("ready");
};
img1.src =
  "data:image/png;base64,";
